window.bookSummaryJSON = "<p><b>My mortal skin is gone.</b></p> <p>I’m one of them—one of the Folk—and all I feel is anger. I’m going to kill the Carlin and her sons for everything they did to me. It’s all I care about.</p> <p>But first, I have to navigate this new world, my new skin, my new brother, and, when I fall into her clutches, my fae mother—the Brid, the Seelie Queen.</p> <p>I don’t like what I’m becoming, but I can’t stop it. Something’s wrong with me. Something’s missing. There’s a hollow ache in my chest, and I can’t fill it, no matter what I do. It’s like I’ve forgotten something vital from my time on unseelie land.</p> <p>Why do I feel so incomplete? Why do I have an oath etched onto my skin, one I don’t remember making? Why is there a tiny black feather nestled in my throat that I can’t bring myself to take off? Why do I feel so much longing every time I see a beautiful, black-haired, black-eyed unseelie fae even though I don’t remember him at all?</p> <p>My life has become yet another game of cat and mouse, but this time, it’s not just the Carlin and her sons trying to get me. New threats lurk and I have to force myself into this new fae skin to be able to fight them.</p> <p><i>Forgotten Vows </i>is the second in a MM fae romance trilogy about a dark fae assassin prince and a mortal. It contains mature content.</p>"; 
